import React from "react";
import {Form,Input} from "antd";

class Add extends React.Component{
    render(){
        return (
            <div>
                 <Form onSubmit={this.handleSubmit}>
                    <Form.Item label="E-mail">
                        <Input />
                    </Form.Item>
                    </Form>
            </div>
        )
    }
}
export default Add;
